import React, { Component } from 'react';

class Lost extends Component {
  render() {
    return (
      <div className="container">
        <div className="jumbotron">
          <h1 className="display-3">404</h1>
          <h4 className="display-5">Page not found</h4>
        </div>
      </div>
    );
  }
}

export default Lost;
